import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  const linkStyle = {
    padding: "10px 20px",
    margin: "0 10px",
    textDecoration: "none",
    color: "white",
    backgroundColor: "#264653",
    borderRadius: "5px",
  };

  const activeStyle = {
    backgroundColor: "#2a9d8f",
  };

  return (
    <nav style={{ padding: "20px", textAlign: "center", background: "#1d3557" }}>
      <NavLink to="/" style={({ isActive }) => (isActive ? { ...linkStyle, ...activeStyle } : linkStyle)}>
        üìä Dashboard
      </NavLink>
      <NavLink to="/upload" style={({ isActive }) => (isActive ? { ...linkStyle, ...activeStyle } : linkStyle)}>
        ‚¨ÜÔ∏è Upload & Create Chart
      </NavLink>
      <NavLink to="/schools-map" style={({ isActive }) => (isActive ? { ...linkStyle, ...activeStyle } : linkStyle)}>
        üó∫Ô∏è Schools Map
      </NavLink>
    </nav>
  );
};

export default Navbar;
